import React from 'react';
import {BrowserRouter as Router,Route} from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css"

import { Provider } from "react-redux";
import store from "./store";

import Navbar from "./components/navbar.component";
import ExerciseList from "./components/exercises-list.component";
import EditExercise from "./components/edit-exercises.component";
import CreateExercise from "./components/create-exercise.component";
import CreateUser from "./components/create-user.component";
import Landing from './components/Landing.component';
import Login from './components/Auth/Login.components';
import Register from './components/Auth/Register.components';



function App() {
  return (
    <Provider store={store}>
      <Router>
        <Navbar/>
          <br/>
            <Route path="/" exact component={Landing}></Route>
            <Route path="/register" exact component={Register}></Route>
            <Route path="/login" exact component={Login}></Route>
            <Route path="/edit/:id" exact component={EditExercise}></Route>
            <Route path="/create" exact component={CreateExercise}></Route>
            <Route path="/user" exact component={CreateUser}></Route>        
      </Router>   
    </Provider>
  );
}

export default App;
